pragma solidity ^0.5.0;

contract Check {
    function checkProduto( string memory etapa) public pure returns (string memory){
        if (keccak256(abi.encodePacked((etapa))) == keccak256(abi.encodePacked(("Plantacao")))){

            return "";
        }

        else if (keccak256(abi.encodePacked((etapa))) == keccak256(abi.encodePacked(("Colheita")))){

            return "";
        }

        else if (keccak256(abi.encodePacked((etapa))) == keccak256(abi.encodePacked(("Transporte")))){

            return "";
        }
    }
}
